//
// Create region data in the database
//

const createRegion = async function (knex, region, shape) {
  await knex.raw(
    `INSERT INTO region(
      id, 
      name, 
      owner_id, 
      show_on_org_map, 
      calculate_statistics, 
      collection_id, 
      properties,
      shape
    )
    VALUES (?, ?, ?, ?, ?, ?, ?, ST_SETSRID(ST_GeomFromGeoJSON(?), 4326));`,
    [
      region.id,
      region.name,
      region.owner_id,
      region.show_on_org_map,
      region.calculate_statistics,
      region.collection_id,
      region.properties,
      shape,
    ],
  );
};
const seed = async function (knex) {

  for (let i = 0; i < geojson.features.length; i += 1) {
    const region = {
      id: uuid(),
      name: geojson.features[i].properties.Name ?? chance.word(),
      owner_id: collectionSeed.collectionOneOwnerId,
      show_on_org_map: true,
      calculate_statistics: true,
      collection_id: collectionSeed.collectionOneId,
      properties: geojson.features[i].properties,
    };
    await createRegion(knex, region, geojson.features[i].geometry);
  }

  for (let i = 0; i < geojson.features.length; i += 1) {
    const region = {
      id: uuid(),
      name: chance.capitalize(chance.word()),
      owner_id: collectionSeed.collectionTwoOwnerId,
      show_on_org_map: true,
      calculate_statistics: true,
      collection_id: collectionSeed.collectionOneId,
      properties: geojson.features[i].properties,
    };
    await createRegion(knex, region, geojson.features[i].geometry);
  }

  // region without a collection
  {
    const i = 2;
    const region = {
      id: uuid(),
      name: chance.capitalize(chance.word()),
      owner_id: collectionSeed.collectionOneOwnerId,
      show_on_org_map: true,
      calculate_statistics: true,
      collection_id: null,
      properties: geojson.features[i].properties,
    };
    await createRegion(knex, region, geojson.features[i].geometry);
  }
};

module.exports = {
  seed,
};
